import React, { useState } from 'react';

const Results = () => {
    const [filteredPlayers, setFilteredPlayers] = useState({
        input1: [],
        input2: [],
    });
    const [values, setValues] = useState({
        input1: '',
        input2: '',
    });
    const players = ['John', 'Paul', 'George', 'Ringo'];

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        const inputValue = value.toLowerCase();
        const filtered = players.filter((player) => player.toLowerCase().includes(inputValue));
        setValues((prevState) => ({ ...prevState, [name]: value }));
        setFilteredPlayers((prevState) => ({ ...prevState, [name]: filtered }));
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        // Do something with the form data
    };

    return (
        <form onSubmit={handleSubmit}>
            <div>
                <input
                    type='text'
                    name='input1'
                    value={values.input1}
                    onChange={handleInputChange}
                    placeholder={'Search for a player'}
                    list='player-list1'
                />
                <datalist id='player-list1'>
                    {filteredPlayers.input1.map((player) => (
                        <option key={player} value={player} />
                    ))}
                </datalist>
            </div>
            <div>
                <input
                    type='text'
                    name='input2'
                    value={values.input2}
                    onChange={handleInputChange}
                    placeholder={'Search for a player'}
                    list='player-list2'
                />
                <datalist id='player-list2'>
                    {filteredPlayers.input2.map((player) => (
                        <option key={player} value={player} />
                    ))}
                </datalist>
            </div>
            <button type='submit'>Submit</button>
        </form>
    );
};

export default Results;
